import { Component } from 'react';

import './card-container.styles.css';

class CardContainer extends Component {
  render() {
    // const { name, email, id } = this.props;

    return (
      <div
        className='card-container'
        key={this.props.individualId}
      >
        <img
          alt={`monster ${this.props.individualName}`}
          src={`https://robohash.org/${this.props.individualId}?set=set2&size=180x180`}
        />
        <h2>{this.props.individualName}</h2>
        <p>{this.props.individualEmail}</p>
      </div>
    );
  }
}

export default CardContainer;
